class Solution:
    def twoSum(self, numbers,target):
        result=[]
        i=0
        j=1
        while i<len(numbers)-1:
            if numbers[i]+numbers[j]==target:
                result.append(i+1)
                result.append(j+1)
                break
            try:
                if numbers[j]+numbers[j+1]==target:
                    result.append(j+1)
                    result.append(j+2)
                    break
            except:
                pass
            if j==len(numbers)-1:
                i+=1
                j=i
            j+=1
        return result
